;(function($, undefined) {

  var sortChildren = function(element, attr) {
    var elements = [];
    for (var i = 0; i < element.childNodes.length; i++) {
      var node = element.childNodes[i];
      if (node.getAttribute) {
        elements.push(node);
      }
    }
    elements.sort(function(a, b) {
      return parseInt(a.getAttribute(attr)) - parseInt(b.getAttribute(attr));
    });

    $(element).empty().append(elements);
  };

  $(function() {

    $('.trials-sorting [data-sort-trials]').on('click', function() {
      var self = $(this);
      var attr = self.attr('data-sort-trials');
      sortChildren($('#trials-list').get(0), attr);
      $(this).parents('.trials-sorting').removeClass('is-opened')
        .find('.current').text(self.text());

      self.parent().prepend(self);
    });

    $('.trials-sorting .current').on('click', function() {
      $(this).parents('.trials-sorting').addClass('is-opened');
    });

    $('body').on('click', function(event) {
      if ($(event.target).parents('.trials-sorting').length == 0) {
        $('.trials-sorting').removeClass('is-opened');
      }
    });

  });

})(jQuery);

;(function($, undefined) {

  var content = $('.cd-main-content');

  $(function() {
    var updateFooter = function() {
      if (content.length == 0) {
        return;
      }
      var contentHeight = content.get(0).scrollHeight;
      var outerHeight = $('body').height() - $('.site-header').height();

      if (contentHeight < outerHeight) {
        var shadowFooter = content.find('.site-footer.fixed-footer');
        if (shadowFooter.length == 0) {
          var footer = content.find('.site-footer');
          shadowFooter = footer.clone().addClass('fixed-footer');
          footer.addClass('fixed-placeholder').after(shadowFooter);
        }
      } else {
        var shadowFooter = content.find('.site-footer.fixed-footer');
        if (shadowFooter.length) {
          shadowFooter.remove();
          content.find('.site-footer.fixed-placeholder')
            .removeClass('fixed-placeholder');
        }
      }
    };

    $(window).on('resize', updateFooter);
    updateFooter();

  });

})(jQuery);
